script: |
  super -f tsv -I q9432.sql | sort > q9432.out

vector: true

inputs:
  - name: q9432.sql
    data: |
      SELECT DISTINCT - COUNT ( * ) AS col0, CASE - - CAST ( NULL AS INTEGER ) WHEN 78 THEN - 20 + + 67 ELSE + 25 * ( - + COUNT ( * ) ) END AS col0;

outputs:
  - name: q9432.out
    data: |
      -1	-25
